import React from 'react';
import {
  Container,
  HeaderContainer,
  Header,
  SkipToContent,
  HeaderName,
  HeaderNavigation,
  HeaderMenuItem,
  HeaderGlobalBar,
  HeaderGlobalAction,
  SideNav,
  SideNavItems,
  SideNavLink,
  SideNavMenu,
  SideNavMenuItem,
  SideNavRail,
  Breadcrumb,
  BreadcrumbItem,
  Button,
  Tabs,
  Tab,
} from 'carbon-components-react';

const props = {
  tabs: {
    selected: 0,
    role: 'navigation',
  },
  tab: {
    role: 'presentation',
    tabIndex: 0,
  },
};



class PzSidenavSet extends React.Component {
  render ({ isSideNavExpanded, onClickSideNavExpand }) {
    return (
        <HeaderContainer>
          <SideNav
            aria-label="Side navigation"
            isRail
            expanded={isSideNavExpanded}
            onOverlayClick={onClickSideNavExpand}>
            <SideNavItems>
              <SideNavMenu>
                title={this.props.title}
                renderIcon={this.props.icon}
                href={this.props.link}
              </SideNavMenu>
            </SideNavItems>
          </SideNav>
        </HeaderContainer>
      )
    }
  }

export default PzSidenavSet;
